import MyNavLink from "../../MyNavLink/MyNavLink";

export default class Home extends Component {
    render() {
        return (
            <div>
                <h2>HomeHomeHome</h2>
                <div>
                    <ul className="nav nav-tabs">
                        <li>
                            <MyNavLink to="/news">News</MyNavLink>
                        </li>
                        <li>
                            <MyNavLink >Message</MyNavLink>
                        </li>
                    </ul>
                    <Route ></Route>

                </div>
            </div>
        );
    }
}
